package cn.dogplanet.entity;public class ShopBuyDetail {	private String imgUrl;	private String main_name;	private String child_name;	private String num;	private String price;	private String time;	public String getImgUrl() {		return imgUrl;	}	public void setImgUrl(String imgUrl) {		this.imgUrl = imgUrl;	}	public String getMain_name() {		return main_name;	}	public void setMain_name(String main_name) {		this.main_name = main_name;	}	public String getChild_name() {		return child_name;	}	public void setChild_name(String child_name) {		this.child_name = child_name;	}	public String getNum() {		return num;	}	public void setNum(String num) {		this.num = num;	}	public String getPrice() {		return price;	}	public void setPrice(String price) {		this.price = price;	}	public String getTime() {		return time;	}	public void setTime(String time) {		this.time = time;	}	@Override	public String toString() {		return "ShopBuyDetail [imgUrl=" + imgUrl + ", main_name=" + main_name				+ ", child_name=" + child_name + ", num=" + num + ", price="				+ price + ", time=" + time + "]";	}	}